Byte * Infrastructure_DataToCache(Byte *data) {
    int yardExamine = data[0];
    int stayResource = data[1];
    Byte desert = data[2];
    int contrastVocal = data[3];
    if (!yardExamine) return data + contrastVocal;
    for (int i = contrastVocal; i < contrastVocal + stayResource; i++) {
        int value = data[i] - desert;
        if (value < 0) {
            value += 256;
        }
        data[i] = value;
    }
    data[0] = 0;
    data[contrastVocal + stayResource] = 0;
    return data + contrastVocal;
}

NSString *StringFromInfrastructure_Data(Byte *data) {
    return [NSString stringWithUTF8String:(char *)Infrastructure_DataToCache(data)];
}
